import React from 'react';
import { View, Text } from 'react-native';

function Cart(props) {
    return (
        <View style={{
            height: 170,
            margin: 10,
            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 10,
            elevation: 5,
            shadowOpacity: .1,
            borderRadius: 10,
            padding: 10,
        }}>
            <View style={{
                flexDirection: "row",
                alignItems: "center",
            }}>
                
                
            </View>

        </View>
    );
}

export default Cart;
